import React from "react";

class Box extends React.Component {
    render() {
        // const {data} = this.state
        return (
            <div className="wrapper">
                <div style={{
                    backgroundColor:`${this.props.color}`
                }}
                className="box">
                    <button onClick={()=>{this.props.handleClick() }}>Change Color</button>
                </div>
            </div>
        )
    }
}

export default Box;
